import Header from "../../component/Header";

import { ButaoDeBusca, DivContent, HomeBackGround, HomeContent, Input, ProfileImage, ProfileInfo } from "./Styles";

const App = () => {
  return (
    <>
      <Header />
      <HomeContent>
        <HomeBackGround src="./git.png" alt="img" />
        <DivContent>
          <div>
            <Input name="usuario" placeholder="Escreva o nome do usuario"/>
            <ButaoDeBusca>Buscar</ButaoDeBusca>
          </div>
          <ProfileInfo>
            <ProfileImage src="./git.png"/>
            <div style={{justifyContent:'center', alignItems: 'center'}}>
              <h3>Eduardo Ngoca</h3>
              <p>Descrição</p>
            </div>
          </ProfileInfo>

        </DivContent>

      </HomeContent>
    </>
  );
};

export default App;
